 1361 Тестирование;



- Начало тестового сценария: Тестовый сценарий-"Порядковый номер теста";

- После нумерации теста и знака двоеточие идет заголовок теста с маленькой буквы;

- Описание одного теста состоит из последовательности шагов выполнения проверки;

- Количество тест-кейсов не менее трех.



Изменила описание тестирования. Такой шаблон тестового сценария будет приемлемым?



Пример:

Тестовый сценарий 1: проверка функциональности входа.

1. Проверьте работу при вводе правильного имени пользователя и пароля.

2: Проверьте операцию, если введены неверные имя пользователя и пароль.

3: Проверьте операцию, если имя пользователя пусто и нажата кнопка входа.
